import React, { useState } from 'react';
import './.css';

const TermLifeInsuranceForm = () => {
  const [gender, setGender] = useState('Male');
  const [name, setName] = useState('PRATHAM R SHET');
  const [dob, setDob] = useState('21/02/1997');
  const [country, setCountry] = useState('India');
  const [phone, setPhone] = useState('*****5442');
  const [whatsappUpdates, setWhatsappUpdates] = useState(true);

  const calculateAge = (birthDate) => {
    const parts = birthDate.split('/');
    if (parts.length !== 3) return '';
    
    const birthYear = parseInt(parts[2]);
    const currentYear = new Date().getFullYear();
    return `${currentYear - birthYear} years`;
  };

  return (
    <div className="container">
      <div className="header">
        <div className="logo-container">
          <img 
            src="https://via.placeholder.com/150x40?text=PolicyBazaar" 
            alt="PolicyBazaar Logo" 
            className="logo" 
          />
          <span className="slogan">HARR FAMILY HOGI INSURED</span>
        </div>
        <div className="btn-group">
          <button className="assist-btn">
            Claim Assistance
          </button>
          <button className="expert-btn">
            Talk to Expert
          </button>
        </div>
      </div>

      <div className="headline">
        <span className="amount">‚Çπ1 Crore</span> life cover starting <span className="price">from ‚Çπ485</span><sup>+</sup><span>/month</span>
      </div>

      <div className="offer-section">
        <div className="offer">
          <span className="offer-icon">‚úì</span>
          <span className="offer-text">Get an Online Discount of 15%</span>
          <sup>#</sup>
        </div>
        <div className="offer">
          <span className="offer-icon">‚úì</span>
          <span className="offer-text">PB Promise Lowest Price Guarantee</span>
          <sup>*</sup>
        </div>
      </div>

      <div className="gender-selector">
        <button 
          className={`gender-btn ${gender === 'Male' ? 'gender-btn-active' : 'gender-btn-inactive'}`}
          onClick={() => setGender('Male')}
        >
          Male
        </button>
        <button 
          className={`gender-btn ${gender === 'Female' ? 'gender-btn-active' : 'gender-btn-inactive'}`}
          onClick={() => setGender('Female')}
        >
          Female
        </button>
      </div>

      <div className="form-control">
        <label className="label">Your Name</label>
        <input 
          type="text" 
          className="input" 
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </div>

      <div className="form-control">
        <label className="label">Date of Birth</label>
        <div className="dob-container">
          <input 
            type="text" 
            className="input dob-input" 
            value={dob}
            onChange={(e) => setDob(e.target.value)}
          />
          <span className="age-display">
            {calculateAge(dob)}
          </span>
        </div>
      </div>

      <div className="form-control">
        <label className="label">Mobile Number</label>
        <div className="phone-input">
          <select 
            className="country-select"
            value={country}
            onChange={(e) => setCountry(e.target.value)}
          >
            <option value="India">India</option>
            <option value="US">US</option>
            <option value="UK">UK</option>
          </select>
          <div className="phone-code">+91</div>
          <input 
            type="text" 
            className="phone-number" 
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
          />
        </div>
      </div>

      <button className="view-plans-btn">
        View Plans
      </button>

      <div className="certified-section">
        <span>Only certified Policybazaar expert will assist you</span>
      </div>

      <div className="whatsapp-section">
        <span>Get updates on WhatsApp</span>
        <label className="toggle-switch">
          <input 
            type="checkbox" 
            className="toggle-input"
            checked={whatsappUpdates}
            onChange={() => setWhatsappUpdates(!whatsappUpdates)}
          />
          <span className={`toggle-slider ${whatsappUpdates ? 'toggle-active' : ''}`}></span>
        </label>
      </div>

      <div className="disclaimer">
        By clicking, you agree to our <a href="#" className="link">Privacy policy</a>, <a href="#" className="link">Terms of Use</a> & <a href="#" className="link">Disclaimers</a>
      </div>

      <div className="stats-section">
        <div className="company-info">
          <div>Policybazaar is one of India's leading digital</div>
          <div>insurance platform</div>
        </div>

        <div className="stars">‚òÖ‚òÖ‚òÖ‚òÖ¬Ω</div>

        <div className="stat-group">
          <div className="stat-value">9.7 <span className="stat-unit">Crore</span></div>
          <div className="stat-label">Registered Consumers</div>
        </div>

        <div className="stat-group">
          <div className="stat-value">51</div>
          <div className="stat-label">Insurance Partners</div>
        </div>

        <div className="stat-group">
          <div className="stat-value">4.9 <span className="stat-unit">Crore</span></div>
          <div className="stat-label">Policies Sold</div>
        </div>
      </div>
    </div>
  );
};

export default TermLifeInsuranceForm;
